"original": |2-
     Note: Some SNMP MIBs use '2' for 'unknown', which corresponds to the
     IPP "out-of-band" value 'unknown'.  See the description of the
     "out-of-band" values at the beginning of Section 5.1.  Therefore,
     attributes of type 'enum' typically start at '3'.
"fixed": |-
  Note: Some SNMP MIBs use '2' for 'unknown', which corresponds to the IPP "out-of-band" value 'unknown'.  See the description of the "out-of-band" values at the beginning of Section 5.1.  Therefore, attributes of type 'enum' typically start at '3'.
"ko": |-
  참고: 일부 SNMP MIB는 '알 수 없음'에 '2'를 사용합니다. 이는 IPP "대역 외" 값 '알 수 없음'에 해당합니다. 섹션 5.1 시작 부분의 "대역 외" 값에 대한 설명을 참조하세요. 따라서 'enum' 유형의 속성은 일반적으로 '3'에서 시작합니다.
